import { useActionState } from "react";


async function increment(previousState: number, formData: any): Promise<number> {
  return previousState + 1;
}

async function decrement(previousState: number, formData: any): Promise<number> {
  return previousState - 1;
}

//incrementとdecrementを合わせたやつ
function countState(){
    if(this.name === "increment"){
        return(
            increment
        )
    }else{
        return (
            decrement
        )
    }
}


export function CounterApp() {
    const[state,countState] = useActionState(countState,0);

  return (
    <form>
      <br />
      {state}
      <button formAction={countState} name="increment">stateIncrement</button>
      <button formAction={countState} name="decrement">stateDecrement</button>
      <br />
    </form>
  );
}
